                    <FontAwesomeIcon icon={faCogs} color={'rgb(204, 0, 0)'}></FontAwesomeIcon>
                </div>
                <div className='shoptab-icon one'>
                    <FontAwesomeIcon icon={faCogs} color={'rgb(204, 0, 0)'}></FontAwesomeIcon>
