                    <FontAwesomeIcon icon={faCogs} color={'rgb(204, 0, 0)'}></FontAwesomeIcon>
                </div>

            </div>
            <div className='shoptab-links-wrapper'>
                GOGO
            </div>
        </div>
    )
}

export default ShopTab;
